// used to create the router of the whole project

import VueRouter from 'vue-router'
import SearchInput from './components/SearchInput.vue'


export default new VueRouter({
    routes:[
        {
            path:'/about',
            component: SearchInput
        },
        {
            path:'/about',
            component: SearchInput
        }
    ]
})
